import './Signup.css';
import {Link} from 'react-router-dom';

function Signup() {
  return (
    <>
          <main>  
        <div className="right">
        </div>
        <div className="left">
        <Link to="/"><p className="logo">lulu school</p></Link>
            <div className="form">
                <h3>Тіркелу</h3>
                <input type="name" id="name" name="name" placeholder="Аты-жөні: "/>
                <input type="email" id="email" name="email" placeholder="Электрондық пошта: "/>
                <input type="password" id="password" name="pass" placeholder="Құпия сөз:"/>
                <input type="password" id="password" name="pass" placeholder="Құпия сөзді растау:"/>
                <br></br>
                <button>Тіркелу</button>
                <p id="butW">Тіркеліп қойғансыз ба? <Link to="/user-login">Кіру</Link></p>
            </div>
        </div>
    </main>
    </>
  );
}

export default Signup;
